                        <Card.Body>
                            <BasicToDo todoList={initialBasicTodo}/>
                        </Card.Body>
                    </Card>
                </Col>
                <Col xl={6}>
                    <Card>
                        <Card.Header>
                            <Card.Title as='h5'>To Do List in Modal</Card.Title>
                        </Card.Header>
                        <Card.Body>
                            <ModalToDo todoList={initialModalTodo}/>
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
        </React.Fragment>
    );
}
export default ToDo;
